drop database if exists `CHINA_olympic_participation` ;
create database `CHINA_olympic_participation`;
use `CHINA_olympic_participation`;



-- ---------------------------------------------------------------------------

DROP TABLE IF EXISTS `china_atletas`;


CREATE TABLE `china_atletas` (
  `id_atleta` int unsigned NOT NULL AUTO_INCREMENT,
  `nome` varchar(45) NOT NULL,
  `sexo` char(1) NOT NULL,
  `idade` tinyint unsigned NOT NULL,
  `altura` int NOT NULL,
  `peso` int NOT NULL,
  `modalidade` varchar(45) NOT NULL,
  PRIMARY KEY (`id_atleta`),
  UNIQUE KEY `id_atleta_UNIQUE` (`id_atleta`)
) ENGINE=InnoDB AUTO_INCREMENT=2363 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


LOCK TABLES `china_atletas` WRITE;
UNLOCK TABLES;

-- ---------------------------------------------------------------------------

DROP TABLE IF EXISTS `olimpiadas`;

CREATE TABLE `olimpiadas` (
  `id_olimpiada` int NOT NULL AUTO_INCREMENT,
  `cidade` varchar(45) DEFAULT NULL,
  `ano` int unsigned DEFAULT NULL,
  `temporada` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`id_olimpiada`),
  UNIQUE KEY `id_olimpiadas_UNIQUE` (`id_olimpiada`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


LOCK TABLES `olimpiadas` WRITE;


UNLOCK TABLES;

-- ---------------------------------------------------------------------------

DROP TABLE IF EXISTS `eventos`;

CREATE TABLE `eventos` (
  `id_evento` int NOT NULL AUTO_INCREMENT,
  `evento` varchar(100) NOT NULL,
  `esporte` varchar(45) NOT NULL,
  PRIMARY KEY (`id_evento`)
) ENGINE=InnoDB AUTO_INCREMENT=512 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


LOCK TABLES `eventos` WRITE;


UNLOCK TABLES;


-- ---------------------------------------------------------------------------

DROP TABLE IF EXISTS `modalidades`;

CREATE TABLE `modalidades` (
  `id_evento` int NOT NULL,
  `id_olimpiada` int NOT NULL,
  KEY `fk_eventos_idx` (`id_evento`),
  KEY `fk_olimpiadas_idx` (`id_olimpiada`),
  CONSTRAINT `fk_eventos` FOREIGN KEY (`id_evento`) REFERENCES `eventos` (`id_evento`),
  CONSTRAINT `fk_olimpiadas` FOREIGN KEY (`id_olimpiada`) REFERENCES `olimpiadas` (`id_olimpiada`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


LOCK TABLES `modalidades` WRITE;


UNLOCK TABLES;

-- ---------------------------------------------------------------------------

DROP TABLE IF EXISTS `participacoes`;

CREATE TABLE `participacoes` (
  `id_atleta` int unsigned NOT NULL,
  `id_olimpiada` int NOT NULL,
  `id_evento` int NOT NULL,
  `medalha` varchar(45) DEFAULT NULL,
  KEY `fk_atleta_idx` (`id_atleta`),
  KEY `fk_olimpiada_idx` (`id_olimpiada`),
  KEY `fk_evento_idx` (`id_evento`),
  CONSTRAINT `fk_atleta` FOREIGN KEY (`id_atleta`) REFERENCES `china_atletas` (`id_atleta`),
  CONSTRAINT `fk_evento` FOREIGN KEY (`id_evento`) REFERENCES `eventos` (`id_evento`),
  CONSTRAINT `fk_olimpiada` FOREIGN KEY (`id_olimpiada`) REFERENCES `olimpiadas` (`id_olimpiada`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

--

LOCK TABLES `participacoes` WRITE;


UNLOCK TABLES;